window.bookSummaryJSON = "<p>If Jax and Elowen want to save Bastian, they must venture to the Solis continent. But a deadly turn of events threatens to crush the kingdoms and destroy their lives.</p> <p>The Dark Raider and I have finally found who he sought, but to truly save him, we must venture to the icy northern land of the Solis continent and seek the fairy who can undo all of the hurt that’s been inflicted on our fae. Yet we unwittingly discover so much more.</p> <p>Sinister secrets come to light. Ploys are foiled. Magical histories are exposed, and unfathomable powers begin to emerge.</p> <p>For the first time in my existence, the future I’ve craved is within my reach.</p> <p>Until it all comes crashing down . . .</p> <p>Overnight disaster strikes, forcing me to make a crushing choice. Only through the ultimate sacrifice will the kingdoms be spared. But how can I pay that price knowing the cost will snuff out the love that’s been written for Jax and me in the stars?</p> <p><i>Queen of Fate</i> is the final book in Fae of Woodlands &amp; Wild, a fae fantasy romance trilogy that takes place in Krista Street's Supernatural World. This series contains slow-burn spicy romance, epic worldbuilding, a female fae who's determined to wield her own fate, a ruthless Dark Raider who will stop at nothing to get what he wants, and a mysterious ploy circulating throughout the kingdoms.</p>"; 
